def monoidS(x,y):
    return x/(x+1), y/2
def monoidR(x,y):
    return 1-x, 1-y
def contFraction(x):
    list = []
    while x > 0.000001:
        if(x >= 1):
            y= floor(x)
            list.append(int(y))
            x = x - y
        else:
            x = 1/x
    return list



def minkowski(x,precision):
    p = floor(x) ### to make mpf just switch to mp floor
    q = mpf(1)
    r = p + 1
    s = mpf(1)
    m = mpf(0)
    n = mpf(0)
    d = mpf(1)
    y = p
    ####  invariants: q * r - p * s == 1 && (double)p / q <= x && x < (double)r / s
    for i in range(precision):
        d = d/2
        if(y + d ==y):
            break
        m = p + r
        if((m < 0)^(p < 0)):
            break
        n = q + s
        if(n < 0):
            break
        if(x < m/n):
            r = m
            s = n
        else:
            y = d+y
            p = m
            q = n
    return y+d
def fixedpointMinkowski(x):
    return minkowski(x,10000)-x
